import { Component } from 'react';
import './Header.css'
import {
  Link
} from "react-router-dom";

class Header extends Component {
    render() {
        return (
          <Link class = "HeaderLink" to = {`/Search`}>
            <div class = "Header">
              Top 20 NBA Players
            </div>
          </Link>
        );
      }
  }

  export default Header;
